import ReactDOM from 'react-dom';
import './index.css'
import {BrowserRouter} from "react-router-dom";
import Body from "./components/Body";
import store from "./redux/store";
ReactDOM.render(
    <BrowserRouter>
        <Body/>
    </BrowserRouter>,
    document.getElementById('root')
);
store.subscribe();
